import React, { Component } from "react";
import Checkbox from "./movieSiteCheckbox.jsx";
import http from "./httpServiceMovie.js"
import queryString from "query-string";
class Show extends Component {
    state = {
        checkForm: { language: [], format: [], genre: [] },
        products: []
    }

    handleClick = (index) => {
        this.props.history.push(`/movieDetails/${index}`);
    }

    async fetchData() {
        let queryParams = queryString.parse(this.props.location.search);
        let searchStr = this.makeSearchString(queryParams);
        let response = await http.get(`/movies?${searchStr}`)
        let { data } = response;
        this.setState({ products: data })
    }

    componentDidMount() {
        this.fetchData();
    }

    componentDidUpdate(prevProps, prevState) {
        if (prevProps !== this.props) this.fetchData();
    }

    callURL = (url, options) => {
        console.log("Saleem111", options)

        let searchString = this.makeSearchString(options);
        this.props.history.push({
            pathname: url,
            search: searchString,
        })
    }

    makeSearchString = (options) => {
        let { lang, genre, format } = options;
        let searchStr = "";
        searchStr = this.addToQueryString(searchStr, "lang", lang);
        searchStr = this.addToQueryString(searchStr, "genre", genre);
        searchStr = this.addToQueryString(searchStr, "format", format);
        return searchStr;
    }

    addToQueryString = (str, paramName, paramValue) =>
    paramValue ? (str ? `${str}&${paramName}=${paramValue}` : `${paramName}=${paramValue}`) : str;

    handleChangeOptions = (options) => {
        this.callURL("/home", options)
    }
    
    render() {
        let { isExpandedLanguage, isExpandedFormat, isExpandedGenre, products } = this.state;
        console.log(products)
        let languages = ["Hindi", "English", "Punjabi", "Tamil"];
        let formats = ["2D", "3D", "4DX"];
        let genres = ["Action", "Adventure"];
        let { language, format, genre } = this.state.checkForm;
        let queryParams = queryString.parse(this.props.location.search);
        return (
            <React.Fragment>
                <div className="container text-center mt-3">
                    <div id="carouselExampleIndicators" className="carousel slide" data-ride="carousel">
                        <ol className="carousel-indicators">
                            <li data-target="#carouselExampleIndicators" data-slide-to="0" className="active"></li>
                            <li data-target="#carouselExampleIndicators" data-slide-to="1"></li>
                            <li data-target="#carouselExampleIndicators" data-slide-to="2"></li>
                        </ol>
                        <div className="carousel-inner">
                            <div className="carousel-item active">
                                <img className="d-block w-100" src="https://i.ibb.co/ZGsJ3dh/jio-mami-21st-mumbai-film-festival-with-star-2019-02-09-2019-10-58-45-992.png" alt="First slide" />
                            </div>
                            <div className="carousel-item">
                                <img className="d-block w-100" src="https://i.ibb.co/wRr7W1P/hustlers-01-10-2019-05-09-55-486.png" alt="Second slide" />
                            </div>
                            <div className="carousel-item">
                                <img className="d-block w-100" src="https://i.ibb.co/qFWPRpF/laal-kaptaan-16-10-2019-12-48-06-721.jpg" alt="Third slide" />
                            </div>
                        </div>
                        <a className="carousel-control-prev" href="#carouselExampleIndicators" role="button" data-slide="prev">
                            <span className="carousel-control-prev-icon" aria-hidden="true"></span>
                            <span className="sr-only">Previous</span>
                        </a>
                        <a className="carousel-control-next" href="#carouselExampleIndicators" role="button" data-slide="next">
                            <span className="carousel-control-next-icon" aria-hidden="true"></span>
                            <span className="sr-only">Next</span>
                        </a>
                    </div>
                </div>

                <div className="row bg-light">
                    <div className="col-6">
                        <div className="row mt-3 ms-2">
                            <div className="col-3"><h4>Movies</h4></div>
                            <div className="col-3">Now Showing</div>
                            <div className="col-3">Coming Soon</div>
                            <div className="col-3">Exclusive</div>
                        </div>
                        <div className="row ms-4 bg-white text-center">
                            <img src="https://i.ibb.co/Hry1kDH/17443322900502723126.jpg" className="h-75 w-75 p-3 bg-secondary" alt="" />
                        </div>

                        <div className="row">
                            <Checkbox options={queryParams} onOptionChange={this.handleChangeOptions} />
                        </div>
                       
                    </div>

                    <div className="col-6">
                        <div className="row mt-4 mr-2">
                            {products.map((ele, index) => (
                                <div className="col-6 mb-4 p-2" style={{backgroundColor: "lightcoral"}}>
                                    <div className="card bg-warning p-3" style={{ width: '18rem;' }} onClick={() => this.handleClick(index)}>
                                        <img
                                            className="card-img-top"
                                            src={index === 0 && "data:image/jpeg;base64,"
                                                || index === 1 && "data:image/jpeg;base64,"
                                                || index === 2 && "data:image/jpeg;base64,"
                                                || index === 3 && "data:image/jpeg;base64,"}
                                            alt="Card image cap" />
                                        <div className="card-body">
                                            <p className="card-text"><b>{ele.title}</b></p>
                                        </div>
                                    </div>
                                </div>
                            ))}
                        </div>
                    </div>
                </div>
            </React.Fragment>
        )
    }
}
export default Show;